class App extends React.Component {
	
	constructor() {
		this.state = {
			businesses: []
		};
	}
	
	searchYelp(term, location, sortBy) {
		console.log('Searching Yelp with Burger, Leyland, location');
	}
  
render() {

return (
    <div className="App">
  <h1>ravenous</h1>
  <SearchBar searchYelp={this.searchYelp} />;
  <BusinessList businesses={businesses}/>;
  
  
</div>)

  }

}



export default App;
